        #region sherlock-and-anagrams
        /// <summary>
        /// https://www.hackerrank.com/challenges/sherlock-and-anagrams/problem?h_l=interview&playlist_slugs%5B%5D=interview-preparation-kit&playlist_slugs%5B%5D=dictionaries-hashmaps
        /// </summary>
        [TestMethod]
        public void SherlockAndAnagramsTest()
        {
            Assert.AreEqual(sherlockAndAnagrams("ifailuhkqq"), 3);
            Assert.AreEqual(sherlockAndAnagrams("abba"), 4);
            Assert.AreEqual(sherlockAndAnagrams("abcd"), 0);
            Assert.AreEqual(sherlockAndAnagrams("kkkk"), 10);
            Assert.AreEqual(sherlockAndAnagrams("cdcd"), 5);
        }

        private int sherlockAndAnagrams(string s)
        {
            var length = s.Length;
            Dictionary<string, int> subsets = new Dictionary<string, int>();
            var resultCount = 0;
            for (int i = 1; i < length; i++)
            {
                for (int j = 0; j + i <= length; j++)
                {
                    var tmp = string.Concat(s.Substring(j, i).OrderBy(c => c));
                    if (subsets.Keys.Contains(tmp))
                        subsets[tmp] = subsets[tmp] + 1;
                    else
                        subsets.Add(tmp, 1);
                }
            }
            resultCount = subsets.Sum(k => k.Value * (k.Value - 1) / 2);
            return resultCount;
        }
