                        {
                            if (collectionItems.TryGetValue(item[1], out int i))
                            {
                                if (i == 1)
                                    collectionItems.Remove(item[1]);
                                else
                                    collectionItems[item[1]] -= i;
                            }
                            break;
                        }
                    case 3:
                        {
                            result.Add((collectionItems.Any(s => s.Value == item[1]) ? 1 : 0));
                            break;
                        }
                    default:
                        break;
                }
            }

            return result;

        }
        #endregion
    }
}
